import React, {Component} from 'react'
import Layout from "../_layouts/default/Layout";

export default class Suggest extends Component {
    render() {
        return (
            <Layout title="Листинг композиций">
                <div>
                    Suggest Form
                </div>
            </Layout>
        )
    }
}
